actionConfiguration.body:
(name, value) => {
  if (name.length == 0 || value.length == 0) {
    showAlert("Invalid Data! Fields cannot be empty.", 'error');
    return;
  }
  var data = appsmith.store['updateVehicleData'];
  data.customData.push({
    "name": name,
    "value": value
  });
  storeValue('updateVehicleData', data);
  closeModal('addCustomData');
}

